AssetTransactions.sol.content:
// Purchase, transfer and sell the asset.
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "./TokeniseAsset.sol";

contract AssetTransactions is TokeniseAsset {

    uint256 public assetPrice;
    mapping(address => uint256) public purchaseHistory;

    event AssetPurchased(address indexed buyer, uint256 amount);
    event AssetSold(address indexed seller, uint256 amount);

    constructor(string memory _title, int _releaseYear, string memory _system, uint256 _initialPrice) TokeniseAsset(_title, _releaseYear, _system) {
        assetPrice = _initialPrice;
    }

    function purchaseAsset(uint256 amount) public payable {
        require(msg.value == assetPrice * amount, "Incorrect ETH sent");
        mint(msg.sender, amount);
        purchaseHistory[msg.sender] += amount;
        emit AssetPurchased(msg.sender, amount);
    }

    function sellAsset(uint256 amount) public {
        require(balanceOf[msg.sender] >= amount, "Insufficient balance to sell");
        uint256 valueToTransfer = assetPrice * amount;
        payable(msg.sender).transfer(valueToTransfer);
        balanceOf[msg.sender] -= amount;
        totalSupply -= amount;
        emit AssetSold(msg.sender, amount);
    }

    function setAssetPrice(uint256 _newPrice) public onlyCreator {
        assetPrice = _newPrice;
    }
}

TokeniseAsset.sol.content:
// Tokenise the asset by creation of the native tokens representing a fractional share of the asset.
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;
import "./DefineAsset.sol";


contract TokeniseAsset is DefineAsset {
    string public name = "FractionalAssetToken";
    string public symbol = "FAT";
    uint8 public decimals = 18;
    uint256 public totalSupply;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor(string memory _title, int _releaseYear, string memory _system) DefineAsset(_title, _releaseYear, _system) {}

    function mint(address to, uint256 amount) public onlyCreator {
        require(to != address(0), "Cannot mint to the zero address");
        totalSupply += amount;
        balanceOf[to] += amount;
        emit Transfer(address(0), to, amount);
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        require(balanceOf[msg.sender] >= amount, "Insufficient balance");
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }
}

DefineAsset.sol.content:
// Allows the user to define an Asset.
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

contract DefineAsset {
    string public gameTitle;
    int public gameReleaseYear;
    string public gameSystem;
    address public creator;

    event AssetCreated(string title, int releaseYear, string system, address creator);

    constructor(string memory _title, int _releaseYear, string memory _system) {
        gameTitle = _title;
        gameReleaseYear = _releaseYear;
        gameSystem = _system;
        creator = msg.sender;
        emit AssetCreated(_title, _releaseYear, _system, msg.sender);
    }

    modifier onlyCreator() {
        require(msg.sender == creator, "Only the creator can perform this action");
        _;
    }
}

